                        1: "First browsers have changed the idea of the World Wide Web. The Internet is becoming available to ordinary people, not just geeks and engineers. Imageboards, chat rooms and site catalogs appear as the first entertainment and information websites. People exchange links and add banners. This is the beginning of the web gold rush, and you are its participant. By the way, if you need to leave the computer, you can enter the game from a mobile phone. Sounds strange for 1995, but try it anyway.",
                        2: "Increase in data transfer speeds now allows the sending of photos and videos. There are the first global companies that operate entirely through the Internet: online shops, banks, search engines. It's time to start something really big. Expand your team and go for it.",
                        3: "The Internet is replacing traditional media. Any user can now start their blog or make a post that can get thousands of views. Websites are getting more complicated from a technical standpoint, while the interface is becoming more streamlined. Copywriters and designers now come to the fore. The most influential websites on the Internet are now search engines. By analyzing the content and number of links to your site, they try to offer users exactly what they are looking for.",
                        4: "Social networks are changing the idea of the web. It turns out that it is not only interesting to read or watch something online, but also to publish content about yourself. The Internet has stopped to be an anonymous place altogether. The main way of monetization now is advertising. Cost per click seems low, but it's compensated by millions of active users that allowed cost per view to dominate.",
                        5: "The Internet is now spreading beyond PCs and mobiles. Cars plan routes, fridges buy groceries, TVs pick movies. Self-aware artificial intelligence has not been invented yet, but Siri and Alexa don't think so. We are so advanced that the new internet-based tools that have been created have put us on the verge of a technological singularity. Use these powerful tools like uKit to create a website and set the world on fire."
